-- Reactivation Analysis Orders Delivered by Week 

CREATE OR REPLACE TEMPORARY TABLE WEEKLY_ANALYSIS AS(
SELECT
  A.DRIVER_ID,
  TO_DATE(A.DATE) AS CAMPAIGN_WEEK,
  DATEADD(DAY, 14, TO_DATE(A.DATE)) AS END_DATE, 
  A.Group_Fixed,
  B.CITY_NAME AS CITY_WORKED,
  A.City AS City_Targeted,
  A.Last_4W,
  A.X_Value,
  A.Y_Value,
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -196, TO_DATE(A.DATE)) AND DATEADD(DAY, 63, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS ORDER_COUNT, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -70, TO_DATE(A.DATE)) AND DATEADD(DAY, -64, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W10, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -63, TO_DATE(A.DATE)) AND DATEADD(DAY, -57, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W9, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -56, TO_DATE(A.DATE)) AND DATEADD(DAY, -50, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W8, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -49, TO_DATE(A.DATE)) AND DATEADD(DAY, -43, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W7, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -42, TO_DATE(A.DATE)) AND DATEADD(DAY, -36, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W6, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -35, TO_DATE(A.DATE)) AND DATEADD(DAY, -29, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W5, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -28, TO_DATE(A.DATE)) AND DATEADD(DAY, -22, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W4, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -21, TO_DATE(A.DATE)) AND DATEADD(DAY, -15, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W3, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -14, TO_DATE(A.DATE)) AND DATEADD(DAY, -8, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W2, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -7, TO_DATE(A.DATE)) AND DATEADD(DAY, -1, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Pre_W1, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN TO_DATE(A.DATE) AND DATEADD(DAY, 6, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS XP_W1, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, 7, TO_DATE(A.DATE)) AND DATEADD(DAY, 14, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS XP_W2, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, 15, TO_DATE(A.DATE)) AND DATEADD(DAY, 21, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Post_W1, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, 22, TO_DATE(A.DATE)) AND DATEADD(DAY, 28, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Post_W2, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, 29, TO_DATE(A.DATE)) AND DATEADD(DAY, 35, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Post_W3, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, 36, TO_DATE(A.DATE)) AND DATEADD(DAY, 42, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Post_W4, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, 43, TO_DATE(A.DATE)) AND DATEADD(DAY, 49, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Post_W5, 
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, 50, TO_DATE(A.DATE)) AND DATEADD(DAY, 56, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Post_W6,
  SUM(CASE WHEN OA_STATUS = 'DELIVERED' AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, 57, TO_DATE(A.DATE)) AND DATEADD(DAY, 63, TO_DATE(A.DATE)) THEN 1 ELSE 0 END) AS Post_W7,
  CASE WHEN CITY_WORKED = City_Targeted THEN 1 ELSE 0 END AS WORKED_TARGET_CITY,
  CASE WHEN Group_Fixed = 'A' AND A.DRIVER_ID IN
    (SELECT driver_id
        FROM braze.rider_engagement
        WHERE ((( sent_at  ) >= ((CONVERT_TIMEZONE('Europe/London', 'UTC', CAST(TO_TIMESTAMP(TO_DATE(A.DATE)) AS TIMESTAMP_NTZ))))
        AND sent_at < ((CONVERT_TIMEZONE('Europe/London', 'UTC', CAST(DATEADD('day', 1, TO_TIMESTAMP(TO_DATE(A.DATE))) AS TIMESTAMP_NTZ)))))) 
        AND campaign_canvas_name = 'rid-multi-reac-rec-gen-global-all-all-week45-20241106-reactivationautomation'
        AND canvas_step_name = 'Email_1_Awareness'
        ) THEN 1 ELSE 0 END AS In_Comms
FROM PRODUCTION.GSHEETS.Reactivation_Campaign_Groups AS A 
  LEFT JOIN production.denormalised.denormalised_assignment AS B ON A.DRIVER_ID = B.DRIVER_ID 
WHERE COUNTRY_NAME IN ('UK', 'Ireland')
  AND TO_DATE(LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -196, TO_DATE(A.DATE)) AND DATEADD(DAY, 63, TO_DATE(A.DATE)) 
  AND A.DRIVER_ID IS NOT NULL
  AND Occurance = 1
  AND Group_Fixed IN ('A', 'B')
GROUP BY
  A.DRIVER_ID,
  A.DATE, 
  B.CITY_NAME,
  A.Group_Fixed,
  A.City,
  END_DATE,
  A.Last_4W,
  A.X_Value,
  A.Y_Value
ORDER BY
  ORDER_COUNT DESC,
  A.DRIVER_ID,
  CITY_NAME
)
;
-- weekly data filtered for worked target city and in comms
CREATE OR REPLACE TEMPORARY TABLE WEEKLY_ANALYSIS_B AS(
SELECT DRIVER_ID, CAMPAIGN_WEEK, END_DATE, Group_Fixed, CITY_WORKED, City_Targeted, Last_4W, X_Value, Y_Value, ORDER_COUNT, 
       Pre_W10, Pre_W9, Pre_W8, Pre_W7, Pre_W6, Pre_W5, Pre_W4, Pre_W3, Pre_W2, Pre_W1, 
       XP_W1, XP_W2, Post_W1, Post_W2, Post_W3, Post_W4, Post_W5, Post_W6, Post_W7

FROM WEEKLY_ANALYSIS 
WHERE WORKED_TARGET_CITY = 1 
AND (GROUP_FIXED = 'B' OR IN_COMMS = 1)
ORDER BY DRIVER_ID, ORDER_COUNT DESC
)
;
SELECT * FROM WEEKLY_ANALYSIS_B ORDER BY DRIVER_ID, ORDER_COUNT DESC;


-- A/B weekly data
SELECT GROUP_FIXED, COUNT(DRIVER_ID), SUM(ORDER_COUNT), SUM(PRE_W10), SUM(PRE_W9), SUM(PRE_W8), SUM(PRE_W7), SUM(PRE_W6), SUM(PRE_W5), SUM(PRE_W4), SUM(PRE_W3), SUM(PRE_W2), SUM(PRE_W1), SUM(XP_W1), SUM(XP_W2), SUM(POST_W1), SUM(POST_W2), SUM(POST_W3), SUM(POST_W4), SUM(POST_W5), SUM(POST_W6), SUM(POST_W7) 
FROM WEEKLY_ANALYSIS_B GROUP BY GROUP_FIXED ORDER BY GROUP_FIXED;

-- A/B data before, during, after XP
SELECT GROUP_FIXED, COUNT(DRIVER_ID),  
       SUM(PRE_W10) + SUM(PRE_W9) + SUM(PRE_W8) + SUM(PRE_W7) + SUM(PRE_W6) + SUM(PRE_W5) + SUM(PRE_W4) + SUM(PRE_W3) + SUM(PRE_W2) + SUM(PRE_W1) as PRE_XP,
       SUM(XP_W1) + SUM(XP_W2) as DURING_XP,
       SUM(POST_W1) + SUM(POST_W2) + SUM(POST_W3) + SUM(POST_W4) + SUM(POST_W5) + SUM(POST_W6) + SUM(POST_W7) as POST_XP,
FROM WEEKLY_ANALYSIS_B GROUP BY GROUP_FIXED ORDER BY GROUP_FIXED;

-- A/B data before, during, after XP by city
SELECT GROUP_FIXED, COUNT(DRIVER_ID), CITY_WORKED,  
       SUM(PRE_W10) + SUM(PRE_W9) + SUM(PRE_W8) + SUM(PRE_W7) + SUM(PRE_W6) + SUM(PRE_W5) + SUM(PRE_W4) + SUM(PRE_W3) + SUM(PRE_W2) + SUM(PRE_W1) as PRE_XP,
       SUM(XP_W1) + SUM(XP_W2) as DURING_XP,
       SUM(POST_W1) + SUM(POST_W2) + SUM(POST_W3) + SUM(POST_W4) + SUM(POST_W5) + SUM(POST_W6) + SUM(POST_W7) as POST_XP,
FROM WEEKLY_ANALYSIS_B GROUP BY CITY_WORKED, GROUP_FIXED ORDER BY CITY_WORKED, GROUP_FIXED;


