  MAX(CASE WHEN Group_Fixed = 'A' AND A.DRIVER_ID IN
    (SELECT driver_id
        FROM braze.rider_engagement
        WHERE sent_at >= CONVERT_TIMEZONE('Europe/London', 'UTC', CAST(TO_TIMESTAMP(TO_DATE(A.DATE)) AS TIMESTAMP_NTZ))
        AND sent_at < CONVERT_TIMEZONE('Europe/London', 'UTC', CAST(DATEADD('day', 1, TO_TIMESTAMP(TO_DATE(A.DATE))) AS TIMESTAMP_NTZ))
        AND campaign_canvas_name = 'rid-multi-reac-rec-gen-global-all-all-week45-20241106-reactivationautomation'
        AND canvas_step_name = 'Email_1_Awareness'
        ) THEN 1 ELSE 0 END) AS In_Comms

FROM PRODUCTION.GSHEETS.Reactivation_Campaign_Groups AS A
  LEFT JOIN production.denormalised.denormalised_assignment AS B
    ON A.DRIVER_ID = B.DRIVER_ID
    -- Join only on driver_id initially. Date/Status filters applied in SUM or WHERE.
    AND B.COUNTRY_NAME IN ('UK', 'Ireland') -- Filter country in join
    -- Filter orders within the relevant overall window for the campaign date in the aggregation step
    AND TO_DATE(B.LOCAL_TIME_OA_CREATED_AT) BETWEEN DATEADD(DAY, -196, TO_DATE(A.DATE)) AND DATEADD(DAY, 71, TO_DATE(A.DATE))
    AND B.OA_STATUS = 'DELIVERED' -- Ensure only delivered orders contribute to sums

WHERE -- Filters on the campaign group table A
      COUNTRY_NAME IN ('UK', 'Ireland') -- Keeping filter on A as per original logic
  AND A.DRIVER_ID IS NOT NULL
  AND A.Occurance = 1
  AND A.Group_Fixed IN ('A', 'B')
  AND B.CITY_NAME = A.City

GROUP BY
  A.DRIVER_ID,
  TO_DATE(A.DATE), -- CAMPAIGN_WEEK_START
  A.Group_Fixed,
  B.CITY_NAME, -- CITY_WORKED (Drivers might work in multiple cities for one campaign week)
  A.City,      -- City_Targeted
  A.Last_4W,
  A.X_Value,
  A.Y_Value

HAVING (A.Group_Fixed = 'B' OR MAX(CASE WHEN A.Group_Fixed = 'A' AND A.DRIVER_ID IN
    (SELECT driver_id
        FROM braze.rider_engagement
        WHERE sent_at >= CONVERT_TIMEZONE('Europe/London', 'UTC', CAST(TO_TIMESTAMP(TO_DATE(A.DATE)) AS TIMESTAMP_NTZ))
        AND sent_at < CONVERT_TIMEZONE('Europe/London', 'UTC', CAST(DATEADD('day', 1, TO_TIMESTAMP(TO_DATE(A.DATE))) AS TIMESTAMP_NTZ))
        AND campaign_canvas_name = 'rid-multi-reac-rec-gen-global-all-all-week45-20241106-reactivationautomation'
        AND canvas_step_name = 'Email_1_Awareness'
        ) THEN 1 ELSE 0 END) = 1)

ORDER BY
  ORDER_COUNT DESC,
  A.DRIVER_ID,
  CITY_NAME
);



